import React, { useEffect, useState } from 'react';

function Posts() {
  const { state, addPost } = usePostsContext();

  

  return (
    <div>
      <h2>Posts with userId 1</h2>
        {state.posts.map((post) => (
          <Post key={post.id} post={post}/>
        ))}
    </div>
  );
}

export default Posts;
